import React, { Component } from "react";

class MainFirst extends Component {
  render() {
    return (
      <div>
        <div className="mac-flex main-first">
          <a href="#">Trang chủ &gt; </a>
          <a href="#">Về XWatch</a>
        </div>
        <div className="main-oclock">
          <h4>Về XWatch</h4>
        </div>
      </div>
    );
  }
}

export default MainFirst;
